    }

    await axios.post(`${process.env.REACT_APP_API}/api/auth/checkMobile`, data).then(res => {
      console.log(res.data)
      if (res.data.Error==false) {
        if(res.data.msg== "Mobile is already verified."){
          this.editListing()
      }else{
        this.handleShow(); 
      }

      }
      else {
